// id values will be unique
const pantrys = [
    { name: 'Cumin', quantity: 2, unit: "Oz" },
    { name: 'salt', quantity: 16, unit: "Oz"},
	{ name: 'white flour', quantity: 24 , unit: "lbs"},
	{ name: 'swiss cheese', quantity: 12, unit: "Oz" },
];

export default pantrys;
